import React from 'react'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import history from '../history'

function BreadCrumb (props) {

    function renderCrumbs() {
        let breadCrumb, url = ''

        url = history.location.pathname
        breadCrumb = url !== '/' ? <Link to={`/`} className="active section">Home</Link> : <div class="active section">Home</div>
        
        url = url.split('/')
 
        url.map(location => {
           breadCrumb += 'Test'
        })
            // if (url[i] === 'streams') {
            //     breadCrumb += <div class="divider"> / </div>
            //     breadCrumb += <Link to={`/`} className="active section">Home</Link>
            // }

        return breadCrumb

    }


    let test = history.location.pathname.split('/')

    console.log(test)
    return (
        <div class="ui breadcrumb">
            {renderCrumbs()}
  {/* 
  <div class="active section">Paper Towels</div> */}
        </div>
    )
}

export default connect (null, {})(BreadCrumb)
